Pregnant? Just track your pregnancy week by week using Pregnancy App.

With Pregnancy App you can easily: 
- track your pregnancy;
- get information about your pregnancy;
- get current pregnancy week and use pregnancy calendar;
- calculate due date (pregnancy date);
- manage contractions with contraction counter
- track kicks with kick counter
- track your pregnancy weight

Pregnancy Tracker is very helpful for a pregnant woman.
Free pregnancy app. 
Powered by Amila.

My Pregnancy is a week-by-week pregnancy tracker. Our app will help you over the course of your pregnancy. Stay on top of the changes happening inside your body. Find out how your baby is developing.

Our app is completely free and does not contain advertising.

This app includes:
- week-by-week advice;
- useful information on fetal development and changes in your body;
- week-by-week fetal measurements and imaging;
- a to-do list for each trimester;
- a list of things you will need for hospital check-in, post-natal care and check-out;
- a weight tracker you can use to follow weight gain;
- a kick counter;
- a contraction timer;
- and much more

We have created this app with love, specially for young mothers.

This app is not intended for medical use and is not a substitute for medical consultation.

If you have any questions or requests, please write to neumandev@gmail.com. We are eager to hear your comments on how to improve the app.

Doctor Online - Health Assistant is a mobile health monitoring service to consult with qualified doctors of any profile in online video, audio and chat 24/7. Family doctors, therapists, pediatricians, urologists, cardiologists, dermatologists, endocrinologists, gynecologists and neuropathologists are ready to help you in the Doctor Online App.

How Doctor Online - Health Assistant works:
Step 1: consultation with a doctor by video, audio or chat;
Step 2: appointment and ordering of laboratory tests;
Step 3: consultation with your doctor by video, audio, or chat, based on the results of the laboratory tests and prescription (doctors do not prescribe prescription medicines);
Step 4: ordering and delivering the medication, notifying you of taking the medication throughout treatment;
Step 5: Final consultation on the user's health status.

In Doctor Online - Health Assistant App you can:
- choose the best specialist for the list of symptoms and responses of other patients;
- consult with the doctor online by chat, audio or video(Temporarily disabled);
- make an appointment at the laboratory and get the interpretation of the laboratory results; 
- order medication, delivery at a convenient time and place for you, or you can get it on your own from the nearest pharmacy;
- receive individual notifications of the time of taking the medicine;
- pay for services by card;
- store all medical history, chronic diseases and allergies in your personal Medical card.

Doctor Online - Health Assistant will help you to solve these and many other issues.

Liki24 - medicines delivery service from 5 thousand pharmacies in Ukraine.

The application can be used from anywhere in the world; Doctor Online - Health Assistant's mission is to be always close to you.

App integration with Health Kit: activity data and health indicators we show in the Doctor Online calendar. Track physical activity and all health statistics in one app.

With every new update, we become stronger and with our development, you receive more services.

We are working with our telecom partners to improve network stability and uptime. If you have any comments or suggestions, please write to support@doctoronline.care

Follow our updates, comment and take care!
